import React from 'react'
import {GoogleMap, withGoogleMap, withScriptjs} from 'react-google-maps'

function Map() {
    return (
       <GoogleMap 
       defaultZoom={6}
       defaultCenter={{lat:42.795,lng:19.233}}/>
    )
}

const WrappedMap = withScriptjs(withGoogleMap(Map))

export default WrappedMap
